import React from "react";
import { useState, useRef } from "react";
import "./App.css";
import styled from "styled-components";
const Img = styled.img`
  width: 300px;
`;
function App() {
  const image1 = require("./img/image1.jpg");
  const image2 = require("./img/image2.jpg");
  return (
    <div>
      <Img src={image1}></Img>
      <Img src={image2}></Img>
    </div>
  );
}

export default App;
